import { React, useEffect, useState } from 'react';
import './Main.css';
import axios from 'axios';

const Main = () => {

    const [breeds, setBreeds] = useState("")

    useEffect(() => {
        axios.get('https://dog.ceo/api/breeds/list/all')
        .then(res => {
            console.log(res.data.message)
            let breedsArr = []
            for(var i in res.data.message){
                console.log(res.data.message[i])
                if(Boolean(res.data.message[i][0])){
                    for(var j in res.data.message[i]){
                        // console.log(`${res.data.message.i} ${res.data.message[i][j]}`)
                        breedsArr.push(`${res.data.message[i][j]}`)
                    }
                }
            }
            // console.log(breedsArr)
        })
        .catch(err => {
            console.log(err)
        })
    }, [])

    // useEffect(() => {
    //     console.log(breeds)
    // }, [breeds])

    return (
        <div>
        </div>
    );
}

export default Main;
